import express from 'express'
import { urlencoded, json } from 'body-parser';

const app = express()

const port = 3008

app.use(urlencoded({ extended: true }));
app.use(json());

app.get('/confirmation', (req, res) => {
  res.send('Hello World!')
})

app.listen(port, () => {
  console.log(`Confirmation app listening on port ${port}`)
})
